fields.description:
一款以科技为题材的重力跑酷游戏，采用3D炫光为特效，完美的场地地图和优良的物理障碍,让玩家体验快速感的冒险游戏！

游戏特点：

真实的场地设计;
高品质的图形;
各种空间和障碍;
逼真的角色动画，
面向现实的重力移动物体
智能设计图及水平。

3D森林舞会是一款单机与联网兼备的街机电玩产品，深受玩家喜爱，超棒酷炫的3D画面，动态倍率单门最高46倍，更多大奖模式，更多刺激玩法，激情无限，永恒经典。

√安卓平台上独一无二的联网加单机电玩森林舞会游戏，百人在线同局对战，美女帅哥同场竞技，各种热闹，各种刺激。
√100%完美移植街机，3D场景震撼无比，特效精美绝伦!彩金，大三元，大四喜，送灯节目 最高可送11灯哦!
√在电玩城森林舞会这个游戏，博的不仅仅是运气，更是分析数据，选择对策，才能令您常胜不败。
√游戏特色:独创金币，等级，奖卷排名，彰显你的实力和运气!
√与众不同的电玩游戏，给您独一无二的娱乐享受!

1.免费下载即可获得游戏中的所有体验;

2.隆重推出单人单机游戏，就算没有网络也可以挑战运气;

3.游戏记录可查看最近6局游戏出分记录，分析规律，冲击高手榜;

4.在线玩家列表查看玩家的金币排名，可时刻关注自己的排名;

5.精美的界面，全面优化保证游戏稳定运行，确保最流畅的游戏体验。

小清新风格的消除游戏，虫虫游戏独家破解。拥有80多个精心设计的关卡，每个都是独特的，充满乐趣和令人惊叹的挑战。游戏还有各种各样的道具，最开始也有教学关卡，赶紧来挑战3星吧！ 

游戏特点
简单易学，可爱的作物，你会沉溺其中; 
解开强大的道具，以帮助富有挑战性的关卡; 
清新唯美的风格，明亮和充满活力的图形效果.

一款防御类游戏，用你的智慧去粉碎敌人的部落和摧毁的兽人!帝国之间的战争和兽人已经开始了!兽人被黑暗诅咒了。他们攻击残酷又激烈,行动迅速,并且几乎是坚不可摧的!据预测,一个真正的勇士将领导军队去征服兽人,并且成为了国家英雄!战士,使用你的骑兵,步兵,弓箭手和矛兵,用你的智慧去粉碎敌人的部落和摧毁的兽人吧!开启新的军队和升级他们的属性来获得更强的军队！ 

游戏特点： 
进攻和防守,使用你的军队摧毁兽穴,捍卫你的城堡; 
建造金矿和法力井来加快创建军队,恢复你的魔法; 
不同兵种混合,骑兵,步兵,弓箭手和矛兵,各有不同的属性和升级路线。良好的组织你的军队可以让你的战斗更有效; 
各种各样的兽人,残忍的、强大的、快速的和几乎坚不可摧的BOSS; 
灵活的玩法和不同的游戏模式,安排不同的形状,进攻和防守; 
精制字符,美丽的景色,华丽的魔法,华丽的效果。而你是英雄领导这一史诗般的战争!

一款血腥爽快的砍杀游戏，玩家需要操控角色前往战场清除恶魔军队。当你选定好族类，拿上斧子、弓箭或是魔法武器，就可以出发去征战沙场了。本作也采用了随机生成机制，也就是说，玩家所见到的地牢都是随机生成的，以保证足够的新鲜度。

游戏特点:
随机生成等级，物品，地牢，BOSS，每次游戏都不一样;
超过40个不同的敌人;
超过50个成就解锁;
许多不同的特殊技能解锁;
自定义你的角色.

真正的欧洲二战策略塔防游戏。作为盟军司令，你将指挥你的部队对纳粹德国的进攻，占领柏林，并最终赢得二战的胜利！

游戏特色:
完全的二战武器装备（火箭筒/B-29轰炸机/履带摩托/虎式坦克/齐柏林飞艇）;
逼真的特效系统，超高清的画面，真实的声音效果;
类似于角色扮演类游戏的武器升级系统;
获取多达27种勋章;
6种不同的防御阵地，空中火力支援;
真实还原二战欧洲战场的战斗;
故事模式和自定义战役共有24张具有挑战性的地图，拥有三种难度和三种游戏模式。

